webpackJsonp([0x834755aae49e],{447:function(e,t){e.exports={data:{markdownRemark:{html:'<p>This is the first of many posts on my new blog! You may be asking yourself,\n<em><center>"Who is Benji, and why do I care?"</center></em></p>\n<p>Great question!</p>\n<p>My interests and hobbies are pretty diverse. For example, I am PADI certified Master Scuba diver, I like to spin fire poi, and I have an Instagram account that I use as a photo journal to catalog bathrooms of the world <a href="http://instagram.com/bathroomsoftheworld">@bathroomsoftheworld</a>. I like to think of myself as a creative goofball that enjoys building things and helping people.</p>\n<p>You might be wondering,</p>\n<p><em><center>"What the hell is a fire poi?"</center></em></p>\n<p><strong><center>Here is a picture of me spinning fire poi</center></strong></p>\n<p><img src="https://github.com/BenjiFischman/websiteImages/blob/master/fire_poi.png?raw=true" alt="fire Poi" title="Fire Poi"></p>\n<p>Professionally and academically, my interests are at the intersection of Human-Computer Interactions, Language, and Design. I will begin a full-time position with Microsoft as a Program Manager this summer, so the NDA will likely restrict the content I can share. But that won\'t stop me from chronicling my experience as a fresh college graduate entering the west coast tech industry.</p>\n<p>Follow my journey to discover what I want to be when I grow up.</p>\n<p>Cheers,</p>\n<p>-Benji Fischman</p>',timeToRead:1,excerpt:'This is the first of many posts on my new blog! You may be asking yourself,\n  "Who is Benji, and why do I care?" Great question! Myâ€¦',frontmatter:{title:"Hello World!",cover:"/logos/logo-1024.png",date:"11/02/2017",category:"misc",tags:["Personal","Blog","Creative Writing"]},fields:{nextTitle:null,nextSlug:null,prevTitle:null,prevSlug:null,slug:"/hello-world"}}},pathContext:{slug:"/hello-world"}}}});
